import React from 'react'
import App from '../AppAddress'

import { AddressProvider } from "./contexts/address-context";
import { FormProvider } from "./contexts/form-context";

const User = () => {

    return (
        <FormProvider>
            <AddressProvider>
                <App/>
            </AddressProvider>
        </FormProvider>
    )
}

export default User
